// import {Header} from './Header.jsx'
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <nav className="app_header">
        <div id="list" align='left'>123</div>
        <div id="logo" align='center'>3 4 5</div>
        <div id="search" align='right'>6 7 8</div>
      </nav>
    </div>
  );
}

export default App;
